import collections


def countNucFreq(seq):
    tempFreqDict = {"A": 0, "C": 0, "G": 0, "T": 0 }
    for nuc in seq:
        tempFreqDict[nuc] += 1
    return tempFreqDict
    # return dict(collections.Counter(seq))

DNAString = ""
result = countNucFreq(DNAString)
print(' '.join([str(val) for key, val in result.items()]))